const fz = require('zigbee-herdsman-converters/converters/fromZigbee');
const tz = require('zigbee-herdsman-converters/converters/toZigbee');
const exposes = require('zigbee-herdsman-converters/lib/exposes');
const constants = require('zigbee-herdsman-converters/lib/constants');
const e = exposes.presets;
const ea = exposes.access;
const {precisionRound} = require('zigbee-herdsman-converters/lib/utils');

const tzLocal = {
    node_config: {
        key: ['reading_interval', 'config_report_enable', 'comparison_previous_data', 'tx_radio_power', 'invert', 'fastmode'],
        convertSet: async (entity, key, rawValue, meta) => {
			const endpoint = meta.device.getEndpoint(1);
            const lookup = {'OFF': 0x00, 'ON': 0x01};
            const value = lookup.hasOwnProperty(rawValue) ? lookup[rawValue] : parseInt(rawValue, 10);
            const payloads = {
                reading_interval: ['genPowerCfg', {0x0201: {value, type: 0x21}}],
				comparison_previous_data: ['genPowerCfg', {0x0205: {value, type: 0x10}}],
				tx_radio_power: ['genPowerCfg', {0x0236: {value, type: 0x28}}],
				invert: ['genPowerCfg', {0xF004: {value, type: 0x20}}],
				fastmode: ['genPowerCfg', {0xF005: {value, type: 0x20}}],
            };
            await endpoint.write(payloads[key][0], payloads[key][1]);
            return {
                state: {[key]: rawValue},
            };
        },
    },
};

const fzLocal = {
    node_config: {
        cluster: 'genPowerCfg',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty(0x0201)) {
                result.reading_interval = msg.data[0x0201];
            }
			if (msg.data.hasOwnProperty(0x0205)) {
				result.comparison_previous_data = ['OFF', 'ON'][msg.data[0x0205]];
            }
			if (msg.data.hasOwnProperty(0x0236)) {
                result.tx_radio_power = msg.data[0x0236];
            }
			if (msg.data.hasOwnProperty(0xA19B)) {
                result.sensor_identifier = msg.data[0xA19B];
            }
			if (msg.data.hasOwnProperty('mainsVoltage')) {
                result.mains_voltage = msg.data['mainsVoltage']/ 10;
				result.mains_voltage = precisionRound(result.mains_voltage, 1);
            }
			if (msg.data.hasOwnProperty(0xF004)) {
                result.invert = msg.data[0xF004];
            }
			if (msg.data.hasOwnProperty(0xF005)) {
                result.fastmode = msg.data[0xF005];
            }
            return result;
        },
    },
};



const definition = {
        zigbeeModel: ['EFEKTA_eTH_POW_E_LR'],
        model: 'EFEKTA_eTH_POW_E_LR',
        vendor: 'EfektaLab',
        description: 'EFEKTA eTH POW - Temperature and humidity smart sensor with with e-ink display.',
        fromZigbee: [fz.temperature, fz.humidity, fz.battery, fzLocal.node_config],
        toZigbee: [tz.factory_reset, tzLocal.node_config],
        icon: 'data:image/png;base64,',
		exposes: [e.temperature(), e.humidity(), e.battery_low(), e.battery(),
			exposes.numeric('mains_voltage', ea.STATE).withUnit('V').withDescription('Mains voltage'),
		    exposes.numeric('reading_interval', ea.STATE_SET).withUnit('Seconds').withDescription('Setting the sensor reading interval (10-300 sec.). Setting the time in seconds, by default 10 seconds')
                .withValueMin(10).withValueMax(300),
			exposes.enum('tx_radio_power', ea.STATE_SET, [0, 4, 10, 19]).withDescription('Set TX Radio Power, dbm)'),
		    exposes.binary('comparison_previous_data', ea.STATE_SET, 'ON', 'OFF').withDescription('Enable сontrol of comparison with previous data'),
			exposes.enum('invert', ea.STATE_SET, [0, 1]).withDescription('Invert display color'),
		    exposes.enum('fastmode', ea.STATE_SET, [0, 1]).withDescription('FM or UFM'),
			exposes.numeric('sensor_identifier', ea.STATE).withDescription('Sensor type, identifier')],
};

module.exports = definition;